import React from 'react'

const Priority = ({priority}) => {
    return (
        <>
            <label style={{"width":"9%","marginRight":"12px","marginTop":"10px","marginLeft":"6px","fontSize":"15px","border":"1px solid white","paddingLeft":"7px","paddingRight":"7px","paddingTop":"3px","paddingBottom":"3px","borderRadius":"9px"}}>
            {priority}                
            </label>
            <span style={{"marginLeft":"10px","marginTop":"6px","height":"13px","width":"13px","backgroundColor":"#ffff00","borderRadius":"50%","display":"inline-block"}}></span>

        </>
    )
}


const IssueElement = (props) => {
    return (
        <>
            <div style={{"textAlign": "right","cursor":"pointer","paddingTop":"9px","paddingLeft":"9px","marginTop":"21px","backgroundColor":"#000000","color":"#FFFFFF","border":"1px solid white","borderRadius":"9px"}} >
                <Priority priority={props.priority}/>
            </div>
        </>
    )
}

export default IssueElement
